class CardsProvider with ChangeNotifier {
// ==================================== Navigator ==============================
  gotToCardPage(context) async {
    await Future.delayed(const Duration(seconds: 2));
    Navigator.pushReplacement(
        context, MaterialPageRoute(builder: (context) => const Cards()));
    createUserDefault();
  }

  void gotToAddCardPage(context) async {
    search('');
    await Navigator.push(context, MaterialPageRoute(builder: (context) {
      return const addCards();
    }));
  }

  void sendItemsToCheckPage(context, item) {
    search('');
    getItemCard(item);
    Navigator.push(
        context,
        MaterialPageRoute(
          builder: (context) => const CheckCard(),
        ));
  }

//============================create users======================================
  final List _cardInfo = [];

  List get cardInfo => _cardInfo;
  final _chars =
      'AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz1234567890';
  final Random _rnd = Random();

  String getRandomString(int length) => String.fromCharCodes(Iterable.generate(
      length, (_) => _chars.codeUnitAt(_rnd.nextInt(_chars.length))));

  createUserDefault() async {
    final preferences = await SharedPreferences.getInstance();

    Map data = {
      "ID": getRandomString(10),
      "name": "John",
      "family_name": "Stewart",
      "address": "manchester",
      "birth_date": "1991-01-13",
      "mobile": "09052233568",
      "id_no": "4980011111",
      "image": base64.encode((await rootBundle.load('assets/images/image1.png'))
          .buffer
          .asUint8List()),
      "deleted": false,
      "is_active": false,
    };
    Map data1 = {
      "ID": getRandomString(10),
      "name": "Jack",
      "family_name": "Stewart",
      "address": "New York",
      "birth_date": "1991-01-13",
      "mobile": "09101687627",
      "id_no": "4980011112",
      "image": base64.encode((await rootBundle.load('assets/images/image2.png'))
          .buffer
          .asUint8List()),
      "deleted": false,
      "is_active": false,
    };
    Map data2 = {
      "ID": getRandomString(10),
      "name": "Natalia",
      "family_name": "Gomez",
      "address": "manchester",
      "birth_date": "1986-06-06",
      "mobile": "09211890565",
      "id_no": "8463830885",
      "image": base64.encode((await rootBundle.load('assets/images/image3.png'))
          .buffer
          .asUint8List()),
      "deleted": false,
      "is_active": true,
    };
    String encodeData = jsonEncode(data);
    String encodeData1 = jsonEncode(data1);
    String encodeData2 = jsonEncode(data2);
    _cardInfo.add(encodeData);
    _cardInfo.add(encodeData1);
    _cardInfo.add(encodeData2);
    preferences.setString('cardInfo', _cardInfo.toString());
    getData();
  }

//===========================get data SharedPreferences=========================
  List _duplicateItems = [];

  List get duplicateItems => _duplicateItems;
  List _items = [];

  List get items => _items;
  final List _deletedList = [];

  List get deletedList => _deletedList;
  bool showBtn = false;
  bool isChecked = false;

  getData() async {
    final pref = await SharedPreferences.getInstance();
    final getData = pref.getString('cardInfo');
    if (getData != null) {
      showBtn = true;
      var decode = jsonDecode(getData);
      _items = decode;
      _duplicateItems = decode;
    }
    notifyListeners();
  }

//===========================search from cards==================================
  TextEditingController editingController = TextEditingController();

  search(String value) {
    List results = [];
    if (value.isEmpty) {
      results = _duplicateItems;
    } else {
      results = _items
          .where((user) =>
              user["name"].toLowerCase().contains(value.toLowerCase()) ||
              user["family_name"].toLowerCase().contains(value.toLowerCase()) ||
              user["id_no"].toLowerCase().contains(value.toLowerCase()))
          .toList();
    }
    _items = results;
    notifyListeners();
  }

//===================================get item by id=============================
  var getItem;
  List itemEdit = [];
  String name = '';
  String familyName = '';
  String mobile = '';
  String iDNo = '';
  String address = '';
  String birthDate = '';
  final format = DateFormat("yyyy-MM-dd");
  String image = '';
  List dataUsers = [];
  List userIdList = [];

  getItemCard(item) async {
    itemEdit = _items;
    for (var i in _items) {
      if (i['ID'] == item) {
        getItem = i;
        name = getItem['name'];
        familyName = getItem['family_name'];
        mobile = getItem['mobile'];
        iDNo = getItem['id_no'];
        address = getItem['address'];
        birthDate = getItem['birth_date'];
        image = getItem['image'];
      }
    }
    notifyListeners();
  }

//====================================update card===============================
  editUser() async {
    var dataCard = [];
    for (var i in itemEdit) {
      if (i["ID"] == getItem["ID"]) {
        i = getItem;
        getItem['name'] = name;
        getItem['family_name'] = familyName;
        getItem['mobile'] = mobile;
        getItem['id_no'] = iDNo;
        getItem['address'] = address;
        getItem['birth_date'] = birthDate.substring(0, 10);
        getItem["image"] = image;
      }
      dataCard.add(i);
    }
    String encodeData = jsonEncode(dataCard);
    final prefs = await SharedPreferences.getInstance();
    prefs.setString('cardInfo', encodeData.toString());
    notifyListeners();
  }

//=======================================add card===============================
  String addName = '';
  String addFamilyName = '';
  String addMobile = '';
  String addIDNo = '';
  String addAddress = '';
  String addBirthDate = '';
  String addImage =
      '';
  String addImageNew = '';
  final _chars1 =
      'AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz1234567890';
  final Random _rnd1 = Random();

  String getRandomString1(int length) => String.fromCharCodes(Iterable.generate(
      length, (_) => _chars1.codeUnitAt(_rnd1.nextInt(_chars1.length))));

  createCard() async {
    Map dataAA = {
      "ID": getRandomString1(10),
      "name": addName,
      "family_name": addFamilyName,
      "address": addAddress,
      "birth_date": addBirthDate.substring(0, 10),
      "mobile": addMobile,
      "id_no": addIDNo,
      "image": addImage,
      "deleted": false,
      "is_active": false,
    };
    _items.add(dataAA);
    final prefs = await SharedPreferences.getInstance();
    prefs.setString('cardInfo', _items.toString());
    notifyListeners();
  }

  //=====================choose image from update card===========================
  choose() async {
    final picker = ImagePicker();
    final pickedFile = await picker.pickImage(
      source: ImageSource.gallery,
      maxHeight: 180,
      maxWidth: 130,
    );
    if (pickedFile != null) {
      final imageBytes = await pickedFile.readAsBytes();
      var base64en = base64.encode(imageBytes);
      image = base64en;
    }
    notifyListeners();
  }

//=====================choose image from add card===============================
  chooseAdd() async {
    final picker = ImagePicker();
    final pickedFile = await picker.pickImage(
      source: ImageSource.gallery,
      maxHeight: 180,
      maxWidth: 130,
    );
    if (pickedFile != null) {
      final imageBytes = await pickedFile.readAsBytes();
      var base64en = base64.encode(imageBytes);
      addImage = base64en;
    }
    notifyListeners();
  }

//===============================check card=====================================
  reject(int num) {
    switch (num) {
      case 0:
        {
          name = " ";
        }
        break;
      case 1:
        {
          familyName = " ";
        }
        break;
      case 2:
        {
          mobile = " ";
        }
        break;
      case 3:
        {
          birthDate = " ";
        }
        break;
      case 4:
        {
          iDNo = " ";
        }
        break;
      case 5:
        {
          address = " ";
        }
        break;
      case 6:
        {
          image =
              '';
        }
        break;
    }
    notifyListeners();
  }

  checkCard() async {
    var dataCard = [];
    for (var i in itemEdit) {
      if (i["ID"] == getItem["ID"]) {
        i = getItem;
        getItem['name'] = name;
        getItem['family_name'] = familyName;
        getItem['mobile'] = mobile;
        getItem['id_no'] = iDNo;
        getItem['address'] = address;
        getItem['birth_date'] = birthDate.substring(0, 10);
        getItem["image"] = image;
        if (name.isNotEmpty &
            familyName.isNotEmpty &
            iDNo.isNotEmpty &
            address.isNotEmpty &
            birthDate.isNotEmpty) {
          getItem["is_active"] = true;
        } else {
          getItem["is_active"] = false;
        }
      }
      dataCard.add(i);
    }
    String encodeData = jsonEncode(dataCard);
    final prefs = await SharedPreferences.getInstance();
    prefs.setString('cardInfo', encodeData.toString());
    notifyListeners();
  }
}
